import React from 'react';
import { Element } from 'react-scroll';

const HomePage = () => {
  return (
    <Element name="home" className="section">
      <h1>Welcome to the Home Page!</h1>
      <p>This is the content of the home page.</p>
      <img src="https://images.unsplash.com/photo-1541963463532-d68292c34b19?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxleHBsb3JlLWZlZWR8M3x8fGVufDB8fHx8fA%3D%3D&w=1000&q=80" alt="Home" />

      <h2>Features</h2>
      <ul>
        <li>Feature 1</li>
        <li>Feature 2</li>
        <li>Feature 3</li>
      </ul>

      <h2>About Us</h2>
      <p>
        We are a leading company specializing in providing innovative solutions
        for our customers. With years of experience and a team of experts, we
        strive to deliver high-quality products and services that exceed
        expectations.
      </p>
    </Element>
  );
};

export default HomePage;
